('2353','15','7880','Villa Serda',Null,'Moderne Designer Villa bei Sineu zu verkaufen','33149','Der Eigentümer, ein Architekt aus Österreich, hat diese moderne Villa geplant und mit exquisiten und hochwertigen Materialien erstellt. Sie steht auf einem flachen, ca 15.000m² großen Grundstück. Durch eine massive Holztüre betritt man den mit Kies bedeckten Innenhof, den sogenannten Patio. Die ca 300m² Wohnfläche verteilt sich auf Wohn-Esszimmer, moderne Einbauküche, Hauswirtschaftsraum, Gäste WC, 2 Gäste Schlafzimmer mit Bad en suite und das Masterschlafzimmer mit begehbarer Ankleide und Bad en suite. Von der Dachterrasse aus hat man einen sehr schönen Panorama Blick. Zur edlen Ausstattung gehören u.a. eine Klima Anlage w/k, Panorama Fenster mit Schiebeelementen, offener Kamin im Wohnzimmer, edle handgefertigte Möbelstücke u.v.m.   Erholen kann man sich am 60m² großen Pool, umgeben von Liegeterrassen. Wasser aus eigener Quelle speist nicht nur den Pool sondern auch das gesamte Haus und den Garten','33150','2450000','106','2015-07-24 13:06:00','106','2015-07-24 13:07:22',Null,'2431','101','1143',1,'1','0',Null,Null,Null,'33151',Null,'0','0','0',Null,'2015-07-24 13:12:46',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33152',Null,'33153',Null,'33154',Null,'33155',Null,'33156','0',0,'5');
